import React, { Component } from 'react';
import './NavBar.css';

import { Link } from 'react-scroll';

class NavBar extends Component {

    state = {
        activeContainer: 'homeContainer'
    }

    render() {
    return (
        <div className='nav-bar'>
            <div>
            <Link className='nav-btn' to='homeContainer'
                spy={true} smooth={true} duration={500}>Home</Link>
                </div>
            <div>
            <Link className='nav-btn' to='educationContainer'
                spy={true} smooth={true} duration={500}>Education</Link>
                </div>
            <div>
            <Link className='nav-btn' to='projectsContainer'
                spy={true} smooth={true} duration={500}>Projects</Link>
                </div>
            <div>
            <Link className='nav-btn' to='contactContainer'
                spy={true} smooth={true} duration={500}>Contact</Link>
                </div>
        </div>
    )
    }

}

export default NavBar;
